import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the search input and extract user profile link
    await page.waitForSelector('#searchInput', { timeout: 5000 });
    const profileLink = await page.$eval('a:contains("Your Profile")', el => el.href);

    // Take screenshot after loading profile link
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_profile_link.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_profile_link.png'));

    // Wait for the profile link and click it
    await page.waitForSelector('a:contains("Your Profile")', { timeout: 5000 });
    await page.click('a:contains("Your Profile")');

    // Take screenshot after navigating to profile
    await page.waitForLoadState('networkidle');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_navigated_to_profile.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_navigated_to_profile.png'));

    // Extract user profile information
    const userProfileData = await page.evaluate(() => {
      return {
        username: document.querySelector('.username').innerText,
        fullName: document.querySelector('.profile-info h2').innerText,
        email: document.querySelector('.email').innerText,
        bio: document.querySelector('.bio').innerText,
      };
    });

    return {
      success: true,
      action: "User profile information harvested successfully",
      extractedData: userProfileData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
